-- ----------------------------
--  Table structure for `sims_lesson`
-- ----------------------------
DROP TABLE IF EXISTS `sims_lesson`;
CREATE TABLE `sims_lesson` (
  `ID` varchar(32) COLLATE utf8mb4_bin NOT NULL COMMENT '课程号',
  `NAME` varchar(128) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '课程名',
  `TEACHER_ID` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '教师ID',
  `STUDENT_ID` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '学生ID',
  `ROOM_ID` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '课室ID',
  `LESSON_START` datetime DEFAULT NULL COMMENT '课程开始时间',
  `LESSON_END` datetime DEFAULT NULL COMMENT '课程结束时间',
  `INTRO` varchar(512) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '课程说明',
  `CREATE_BY` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '创建人',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  `UPDATE_BY` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '更新人',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '更新时间',
  `LESSON_STATUS` int(11) DEFAULT '0' COMMENT '课程状态 0未开始 1教师进入课室 2学生进入教室 3已完成 4缺课',
  `RESERVE` int(11) DEFAULT '0' COMMENT '预定状态 0 未预定 1已经预定 ',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='课程 ';

