--  Table structure for `sims_rescource_opern_lesson`
-- ----------------------------
DROP TABLE IF EXISTS `sims_rescource_opern_lesson`;
CREATE TABLE `sims_rescource_opern_lesson` (
  `REVISION` int(11) DEFAULT NULL COMMENT '乐观锁',
  `CREATE_BY` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '创建人',
  `CREATE_TIME` datetime DEFAULT NULL COMMENT '创建时间',
  `UPDATE_BY` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '更新人',
  `UPDATE_TIME` datetime DEFAULT NULL COMMENT '更新时间',
  `ROOM_ID` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '房间号',
  `OPERN_ID` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '资源号',
  `STUDENT_ID` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '学生号',
  `ID` varchar(32) COLLATE utf8mb4_bin NOT NULL COMMENT '房间资料关联号',
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='资料房间关系';

