  `DOMICILE_PLACE_ADDRESS` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '户籍地址',
  `HOBBY` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '爱好',
  `INTRO` varchar(512) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '简要介绍',
  `PRESENT_ADDRESS` varchar(128) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '居住地址',
  `EMAIL` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '电子邮件',
  `ENTRY_DATE` date DEFAULT NULL COMMENT '入学日期',
  `STATUS` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '状态',
  `CREATE_BY` varchar(32) COLLATE utf8mb4_bin DEFAULT NULL COMMENT '创建人',
